    false,nt"url": null,nt"notes": "As a measure for the protection of their
    young, some bid species establish territories which surround their nests. A territorial
    behavior is practiced within the territory in response to a stranger with in his
    territory. A determinate factor of this behavior is the condition of the young.
    In the Western Kingbird territorial behavior changes as the young develop. A study
    was conducted on a pair of Kingbirds and their young to illustrate their changed
    behavior. The study will examine what is the territorial area of the Kingbird and:
    (1) territorial responses and displays of the parent Kingbirds while the young were
    in the nestling and fledgling condition, (2) the lack of territorial responses and
    display by the fledglings when the parent birds were absent.",nt"owner_org":
